import React, { useState, useRef, useEffect } from 'react';
import { useDropzone } from 'react-dropzone';
import { toast } from 'react-toastify';

const VideoProcessor = ({ onSessionUpdate, onDetectionUpdate, onViolationUpdate, currentSession }) => {
  const [selectedFile, setSelectedFile] = useState(null);
  const [isProcessing, setIsProcessing] = useState(false);
  const [processingProgress, setProcessingProgress] = useState(0);
  const [currentFrame, setCurrentFrame] = useState(null);
  const [detections, setDetections] = useState([]);
  const [violations, setViolations] = useState([]);
  const [fps, setFps] = useState(10);

  const videoRef = useRef(null);
  const canvasRef = useRef(null);
  const wsRef = useRef(null);

  // Handle file drop
  const onDrop = (acceptedFiles) => {
    const file = acceptedFiles[0];
    if (file && file.type.startsWith('video/')) {
      setSelectedFile(file);
      toast.success(`Video selected: ${file.name}`);
    } else {
      toast.error('Please select a valid video file');
    }
  };

  const { getRootProps, getInputProps, isDragActive } = useDropzone({
    onDrop,
    accept: {
      'video/*': ['.mp4', '.avi', '.mov', '.mkv', '.webm']
    },
    multiple: false
  });

  // Start video processing
  const startProcessing = async () => {
    if (!selectedFile) {
      toast.error('Please select a video file first');
      return;
    }

    try {
      console.log('üöÄ Starting video processing...');
      console.log('üìÅ Selected file:', selectedFile.name, selectedFile.size, 'bytes');

      setIsProcessing(true);
      setProcessingProgress(0);
      setDetections([]);
      setViolations([]);

      // Upload video file first
      console.log('üì§ Uploading video file...');
      const formData = new FormData();
      formData.append('video', selectedFile);

      const uploadResponse = await fetch('/api/upload', {
        method: 'POST',
        body: formData
      });

      console.log('üì§ Upload response status:', uploadResponse.status);

      if (!uploadResponse.ok) {
        const errorText = await uploadResponse.text();
        console.error('‚ùå Upload failed:', errorText);
        throw new Error(`Failed to upload video: ${errorText}`);
      }

      const uploadResult = await uploadResponse.json();
      console.log('‚úÖ Upload successful:', uploadResult);

      // Start video processing
      console.log('üé¨ Starting video processing...');
      const processingRequest = {
        source_type: 'file',
        source_path: uploadResult.filename,
        fps: fps,
        enable_violation_detection: true
      };

      console.log('üì° Processing request:', processingRequest);

      const processingResponse = await fetch('/video/start', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify(processingRequest)
      });

      console.log('üé¨ Processing response status:', processingResponse.status);

      if (!processingResponse.ok) {
        const errorText = await processingResponse.text();
        console.error('‚ùå Processing failed:', errorText);
        throw new Error(`Failed to start video processing: ${errorText}`);
      }

      const result = await processingResponse.json();
      console.log('‚úÖ Processing started successfully:', result);
      onSessionUpdate(result);

      // Connect to WebSocket for real-time updates
      if (result.websocket_url) {
        console.log('üîå Connecting to WebSocket:', result.websocket_url);
        connectWebSocket(result.session_id, result.websocket_url);
      } else {
        console.log('üîå Using default WebSocket URL for session:', result.session_id);
        connectWebSocket(result.session_id);
      }

      toast.success('Video processing started successfully!');

    } catch (error) {
      console.error('‚ùå Processing error:', error);
      toast.error(`Failed to start processing: ${error.message}`);
      setIsProcessing(false);
    }
  };

  // Connect to WebSocket for real-time updates
  const connectWebSocket = (sessionId, wsUrl = null) => {
    const websocketUrl = wsUrl || `ws://localhost:8001/ws/${sessionId}`;
    console.log('üîå Attempting WebSocket connection to:', websocketUrl);

    wsRef.current = new WebSocket(websocketUrl);

    wsRef.current.onopen = () => {
      console.log('‚úÖ WebSocket connected successfully');
      toast.success('Connected to real-time feed');

      // Send ping to keep connection alive
      const pingInterval = setInterval(() => {
        if (wsRef.current && wsRef.current.readyState === WebSocket.OPEN) {
          wsRef.current.send(JSON.stringify({ type: 'ping' }));
        } else {
          clearInterval(pingInterval);
        }
      }, 30000); // Ping every 30 seconds
    };

    wsRef.current.onmessage = (event) => {
      try {
        const data = JSON.parse(event.data);
        console.log('üì® WebSocket message received:', data.type, data);

        if (data.type === 'connection_established') {
          console.log('üîó WebSocket connection established for session:', data.session_id);
        }

        if (data.type === 'frame_processed') {
          console.log('üñºÔ∏è Frame processed:', data.frame_id, 'Detections:', data.detections?.length || 0);
          setCurrentFrame(data.frame_data);
          setProcessingProgress(data.progress || 0);

          // Update detections
          if (data.detections) {
            setDetections(data.detections);
            onDetectionUpdate(data);
            console.log('üîç Updated detections:', data.detections);
          }

          // Update violations
          if (data.violations && data.violations.length > 0) {
            console.log('üö® Violations detected:', data.violations);
            setViolations(prev => [...prev, ...data.violations]);
            data.violations.forEach(violation => {
              onViolationUpdate(violation);
              toast.error(`üö® Violation Detected: ${violation.description}`);
            });
          }

          // Draw detections on canvas
          drawDetections(data.detections || []);
        }

        if (data.type === 'processing_complete') {
          console.log('‚úÖ Video processing completed');
          setIsProcessing(false);
          setProcessingProgress(100);
          toast.success('Video processing completed!');
        }

        if (data.type === 'pong') {
          console.log('üèì Pong received');
        }

      } catch (error) {
        console.error('‚ùå WebSocket message error:', error);
      }
    };

    wsRef.current.onclose = (event) => {
      console.log('üîå WebSocket disconnected. Code:', event.code, 'Reason:', event.reason);
      setIsProcessing(false);

      if (event.code !== 1000) { // Not a normal closure
        toast.warning('Connection lost. Attempting to reconnect...');

        // Attempt to reconnect after 3 seconds
        setTimeout(() => {
          if (!wsRef.current || wsRef.current.readyState === WebSocket.CLOSED) {
            console.log('üîÑ Attempting to reconnect WebSocket...');
            connectWebSocket(sessionId, websocketUrl);
          }
        }, 3000);
      }
    };

    wsRef.current.onerror = (error) => {
      console.error('‚ùå WebSocket error:', error);
      toast.error('WebSocket connection error occurred');
      setIsProcessing(false);
    };
  };

  // Draw detection bounding boxes on canvas
  const drawDetections = (detectionList) => {
    const canvas = canvasRef.current;
    const video = videoRef.current;

    if (!canvas || !video) return;

    const ctx = canvas.getContext('2d');
    canvas.width = video.videoWidth || 640;
    canvas.height = video.videoHeight || 480;

    // Clear canvas
    ctx.clearRect(0, 0, canvas.width, canvas.height);

    // Draw bounding boxes
    detectionList.forEach(detection => {
      const { bbox, class_name, confidence } = detection;

      // Set color based on object type
      let color = '#00ff00'; // Default green
      if (class_name === 'hand') color = '#00ffff'; // Cyan
      if (class_name === 'person') color = '#ff00ff'; // Magenta
      if (class_name === 'scooper') color = '#00ff00'; // Green
      if (class_name === 'violation') color = '#ff0000'; // Red

      // Draw bounding box
      ctx.strokeStyle = color;
      ctx.lineWidth = 3;
      ctx.strokeRect(bbox.x1, bbox.y1, bbox.x2 - bbox.x1, bbox.y2 - bbox.y1);

      // Draw label
      ctx.fillStyle = color;
      ctx.font = '16px Arial';
      const label = `${class_name}: ${(confidence * 100).toFixed(1)}%`;
      const textWidth = ctx.measureText(label).width;

      // Label background
      ctx.fillRect(bbox.x1, bbox.y1 - 25, textWidth + 10, 25);

      // Label text
      ctx.fillStyle = '#000000';
      ctx.fillText(label, bbox.x1 + 5, bbox.y1 - 5);
    });
  };

  // Stop processing
  const stopProcessing = async () => {
    if (currentSession) {
      try {
        await fetch(`/video/stop/${currentSession.session_id}`, {
          method: 'POST'
        });

        if (wsRef.current) {
          wsRef.current.close();
        }

        setIsProcessing(false);
        toast.info('Video processing stopped');
      } catch (error) {
        console.error('Stop processing error:', error);
        toast.error('Failed to stop processing');
      }
    }
  };

  // Cleanup on unmount
  useEffect(() => {
    return () => {
      if (wsRef.current) {
        wsRef.current.close();
      }
    };
  }, []);

  return (
    <div className="grid grid-2">
      {/* Video Upload and Controls */}
      <div className="card">
        <div className="card-header">
          <h2 className="card-title">üé• Video Processing</h2>
        </div>

        {!selectedFile ? (
          <div {...getRootProps()} className={`upload-area ${isDragActive ? 'drag-over' : ''}`}>
            <input {...getInputProps()} />
            <div style={{ textAlign: 'center' }}>
              <div style={{ fontSize: '48px', marginBottom: '16px' }}>üìÅ</div>
              <h3>Drop video file here or click to browse</h3>
              <p>Supports MP4, AVI, MOV, MKV, WebM</p>
            </div>
          </div>
        ) : (
          <div>
            <div style={{ marginBottom: '20px', padding: '16px', background: 'rgba(255,255,255,0.1)', borderRadius: '8px' }}>
              <h4>üìπ Selected Video:</h4>
              <p><strong>Name:</strong> {selectedFile.name}</p>
              <p><strong>Size:</strong> {(selectedFile.size / 1024 / 1024).toFixed(2)} MB</p>
              <p><strong>Type:</strong> {selectedFile.type}</p>
            </div>

            <div style={{ marginBottom: '20px' }}>
              <label style={{ display: 'block', marginBottom: '8px' }}>
                <strong>Processing FPS:</strong>
              </label>
              <input
                type="range"
                min="1"
                max="30"
                value={fps}
                onChange={(e) => setFps(parseInt(e.target.value))}
                style={{ width: '100%', marginBottom: '8px' }}
              />
              <span>{fps} FPS</span>
            </div>

            <div style={{ display: 'flex', gap: '12px' }}>
              {!isProcessing ? (
                <>
                  <button className="btn btn-success" onClick={startProcessing}>
                    ‚ñ∂Ô∏è Start Processing
                  </button>
                  <button className="btn btn-warning" onClick={() => setSelectedFile(null)}>
                    üîÑ Select Different Video
                  </button>
                </>
              ) : (
                <button className="btn btn-danger" onClick={stopProcessing}>
                  ‚èπÔ∏è Stop Processing
                </button>
              )}
            </div>
          </div>
        )}

        {isProcessing && (
          <div style={{ marginTop: '20px' }}>
            <div style={{ display: 'flex', justifyContent: 'space-between', marginBottom: '8px' }}>
              <span>Processing Progress</span>
              <span>{processingProgress.toFixed(1)}%</span>
            </div>
            <div className="progress-bar">
              <div 
                className="progress-fill" 
                style={{ width: `${processingProgress}%` }}
              ></div>
            </div>
          </div>
        )}
      </div>

      {/* Real-time Video Display */}
      <div className="card">
        <div className="card-header">
          <h2 className="card-title">üîç Real-time Detection</h2>
        </div>

        <div className="video-container">
          {currentFrame ? (
            <div style={{ position: 'relative' }}>
              <img 
                ref={videoRef}
                src={`data:image/jpeg;base64,${currentFrame}`}
                alt="Current frame"
                style={{ width: '100%', height: 'auto', borderRadius: '8px' }}
                onLoad={() => drawDetections(detections)}
              />
              <canvas 
                ref={canvasRef}
                className="detection-canvas"
                style={{ position: 'absolute', top: 0, left: 0, width: '100%', height: '100%' }}
              />
            </div>
          ) : (
            <div style={{ 
              display: 'flex', 
              alignItems: 'center', 
              justifyContent: 'center', 
              height: '300px',
              background: 'rgba(0,0,0,0.3)',
              borderRadius: '8px'
            }}>
              <div style={{ textAlign: 'center' }}>
                <div style={{ fontSize: '48px', marginBottom: '16px' }}>üì∫</div>
                <p>Video feed will appear here during processing</p>
              </div>
            </div>
          )}
        </div>

        {/* Detection Stats */}
        {detections.length > 0 && (
          <div style={{ marginTop: '16px' }}>
            <h4>Current Detections:</h4>
            <div className="detection-list" style={{ maxHeight: '150px', overflowY: 'auto' }}>
              {detections.map((detection, index) => (
                <div key={index} className={`detection-item ${detection.class_name}`}>
                  <strong>{detection.class_name}</strong> - {(detection.confidence * 100).toFixed(1)}%
                  <br />
                  <small>
                    Position: ({detection.bbox.x1.toFixed(0)}, {detection.bbox.y1.toFixed(0)}) - 
                    ({detection.bbox.x2.toFixed(0)}, {detection.bbox.y2.toFixed(0)})
                  </small>
                </div>
              ))}
            </div>
          </div>
        )}

        {/* Violation Alerts */}
        {violations.length > 0 && (
          <div style={{ marginTop: '16px' }}>
            <h4 style={{ color: '#ef4444' }}>üö® Recent Violations:</h4>
            <div style={{ maxHeight: '100px', overflowY: 'auto' }}>
              {violations.slice(-3).map((violation, index) => (
                <div key={index} className="violation-alert">
                  <strong>{violation.violation_type}</strong>
                  <br />
                  <small>{violation.description}</small>
                </div>
              ))}
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default VideoProcessor;
